function isinArray(value, array) {
	return array.indexOf(value) > -1;
}

function filterB(alst, breadth) {
	var len = alst.length;
	var newlst = [];
	if (breadth == '0') {
		return alst;
	}
	for (var i = 0; i < len; ++i) {
		if (isinArray(alst[i].slice(0,8), b_dict[breadth])) {
			newlst.push(alst[i]);
		}
	}
	return newlst;
}
	
function filtery(alst, year) {
	var len  = alst.length;
	var newlst = [];
	if (year == '0') {
		return alst;
	}
	for (var i = 0; i < len; ++i) {
		if (alst[i].charAt(3) == year) {
			newlst.push(alst[i]);
		}
	}
	return newlst;
}
function fives(lst) {
	
	var len = lst.length;
	var output = [];
	for (var index = 0; index < len; ++index) {
		var link = 'http://www.artsandscience.utoronto.ca/ofr/calendar/crs_' + lst[index].slice(0,3).toLowerCase() + '.htm#' + lst[index].slice(0,8);
		if (index % 5 == 0 && index != 0) {
			output.push('\n' + "  <a href='{0}' target='_blank'>{1}</a>".format(link, lst[index]));
		}
		else {
			output.push("  <a href='{0}' target='_blank'>{1}</a>".format(link, lst[index]));
		}
	}
	return output;
}

function isNumeric(n) {
  return !isNaN(parseFloat(n)) && isFinite(n);
}
String.prototype.contains = function(it) { return this.indexOf(it) != -1; };
if (!String.prototype.format) {
  String.prototype.format = function() {
    var args = arguments;
    return this.replace(/{(\d+)}/g, function(match, number) { 
      return typeof args[number] != 'undefined'
        ? args[number]
        : match
      ;
    });
  };
}
function dictSearch(day, time, sem, year, breadth) {
    var resultc = [];
	for (var slot in schedule) {
		if (slot.contains(day)) {
			if (slot.contains('-')) {
				var starttime = slot.slice(0,slot.indexOf('-'));
			}
			else {
				var starttime = slot;
			}
			var cindex = 0;
			for (var i = 0, len = starttime.length; i < len; i++) {
				if (isNumeric(starttime[i])) {
					cindex = starttime.indexOf(starttime[i]);
					break;
				}
			}
			hour = starttime.slice(cindex);
			if (hour == time) {
				for (var i = 0, len = schedule[slot].length; i < len; i++) {
					var course = schedule[slot][i];
					if (course[course.length-1] == sem) {
						resultc.push(course);
					}
				}
			}
		}
	}
	return fives(filterB(filtery(resultc, year), breadth));	
}


	
